import React from 'react';
import './result.css'

function Result({ weather }) {
    return (
        <div className='weather-box'>
            {weather ? (
                <div className='header'>
                    <h1>{weather.location.name}</h1>
                    <h2>{weather.location}</h2>
                </div>
            ) : (
                <p>what</p>
            )}
        </div>
    );
}

export default Result;
